import React, { useState } from 'react';
import './index.css';



const App = () => {
    let b = new Date().toLocaleTimeString();
    
    let [time1 , update1 ] = useState(b);

    let Clk = () => {
        let b = new Date().toLocaleTimeString();
        update1(b);
    }

    return (
        <>
            <div className='ab'>
                <h1>{time1}</h1>
                <button type="button" onclick={Clk}>Get Time</button>
            </div>
        </>
    );
}

export default App;
